const joinChannel = serverVars("createVoice");
if (joinChannel) {
    if (me.permissions.has('MOVE_MEMBERS')) {
        if (me.permissions.has('MANAGE_CHANNELS')) {
            const server = tempVars('after').guild;
            const newUserChannel_id = tempVars("after").channelID;
            const oldUserChannel_id = tempVars("prior").channelID;
            const newUserChannel = server.channels.cache.get(newUserChannel_id);
            const oldUserChannel = server.channels.cache.get(oldUserChannel_id);
            const TheUser = server.members.cache.get(tempVars('after').id)
            const parent_ID = joinChannel.parentID;
            const Vname = TheUser.displayName + "ðŸ”Š";
            const options = {
                type: 'voice',
                parent: parent_ID,
                permissionOverwrites: [{
                    id: server.id,
                    allow: ['CONNECT']
                }, {
                    id: TheUser.id,
                    allow: ['CONNECT', 'MANAGE_CHANNELS']
                }]
            };

            if (newUserChannel == joinChannel) {
                if (oldUserChannel && oldUserChannel.name == Vname) {
                    oldUserChannel.delete();
                    server.channels.create(Vname, options)
                        .then(function (channel) {
                            TheUser.voice.setChannel(channel);
                        }.bind(this))
                        .catch(this.displayError.bind(this));
                } else {
                    server.channels.create(Vname, options)
                        .then(function (channel) {
                            TheUser.voice.setChannel(channel);
                        }.bind(this))
                        .catch(this.displayError.bind(this));
                }
            } else if (oldUserChannel && oldUserChannel !== joinChannel && oldUserChannel.name == Vname) {
                oldUserChannel.delete();
            } else if (oldUserChannel && oldUserChannel !== joinChannel && oldUserChannel.name.includes('-private')) {
                oldUserChannel.delete();
            }
        } else {
            console.log('The bot is missing MANAGE_CHANNELS permission.');
        }
    } else {
        console.log('The bot is missing MOVE_MEMBERS permission.');
    }
}
